import React from 'react';
import { Link } from 'react-router-dom';
import './training.css';
import About_img from '../../assets/About.jpg';

const Training = () => {
  return (
    <div class="container_training" id='training'>
      <img src={About_img} alt="About_img" />
      <div class="text_training">А здесь будет о тренировках и больщая кнопка, которая ведет на другую страницу
      <Link to="/other-page" className="button">Перейти на другую страницу</Link> {/* Добавляем Link вокруг кнопки */}
      </div>
    </div>
  )
}

export default Training
